import React from 'react';
import Navbar from './Navbar';

const Home = ()=>{
    return(
        <>
        <Navbar />

            <div className="container">
                <div className="row">
                    <div className='first'></div>
                    <div className='second'></div>
                </div>
            </div>
        </>
    )
}
export default Home;
